import globals from 'globals';

export default [{
    languageOptions: {
        globals: {
            ...globals.browser,
            ...globals.mocha,
            ...globals.node,
            dashjs: true,
            ManagedMediaSource: true,
            WebKitMediaSource: true,
            MediaSource: true,
            WebKitMediaKeys: true,
            MSMediaKeys: true,
            MediaKeys: true,
            google: true,
        },

        ecmaVersion: 2020,
        sourceType: 'module',

        parserOptions: {
            parser: '@babel/eslint-parser',
            requireConfigFile: false,
        },
    },

    rules: {
        'no-caller': 2,
        'no-undef': 2,
        'no-unused-vars': [
            'error',
            {
                vars: 'all',
                args: 'after-used',
                ignoreRestSiblings: true,
                caughtErrors: 'none' // Allow unused variables in catch blocks
            }
        ],
        'no-use-before-define': 0,
        strict: 0,
        'no-loop-func': 0,
        'no-multi-spaces': 'error',

        'keyword-spacing': ['error', {
            before: true,
            after: true,
        }],

        quotes: ['error', 'single', {
            allowTemplateLiterals: true,
        }],

        indent: ['error', 4, {
            SwitchCase: 1,
        }],

        curly: ['error', 'all'],

        'space-infix-ops': ['error', {
            int32Hint: true,
        }],
    },
}];

const fs = require('fs');
const path = require('path');


const precommitTemplate = `#!/usr/bin/env node

var exec = require('child_process').exec;

exec('npm run lint', {
       cwd: '${__dirname.toString().replace(/\\/g, '\\\\').replace(/'/g, '\\\'')}'
     }, function (err, stdout, stderr) {

  var exitCode = 0;
  if (err) {
    console.log(stderr || err);
    exitCode = -1;
  }

  process.exit(exitCode);
}).stdout.on('data', function (chunk){
    process.stdout.write(chunk);
});
`;

const callerTemplate = `#!/bin/sh

node .git/hooks/pre-commit.cjs;`

const pathToHooksFolder = path.join(`${__dirname}`, '.git', 'hooks');

function writeHook(name, content) {
    const precommitFile = path.join(pathToHooksFolder, name);
    fs.writeFile(precommitFile, content, { mode: 0o755 }, (err) => {
        if (err) throw err;
        console.log(`${precommitFile} created.`);
    });
}

fs.access(pathToHooksFolder, (err) => {
    if (err) {
        fs.mkdir(pathToHooksFolder, { recursive: true }, (err) => {
            if (err) throw err;
            writeHook('pre-commit.cjs', precommitTemplate);
            writeHook('pre-commit', callerTemplate);
        });
    } else {
        writeHook('pre-commit.cjs', precommitTemplate);
        writeHook('pre-commit', callerTemplate);
    }
});

